import React from 'react';

const Login = () => {
  return (
    <div className="max-w-md mx-auto p-6 bg-white rounded shadow">
      <h2 className="text-2xl font-semibold mb-4">User Login</h2>
      <form>
        <input type="text" placeholder="Username" className="block w-full mb-3 p-2 border rounded" />
        <input type="password" placeholder="Password" className="block w-full mb-3 p-2 border rounded" />
        <button className="bg-blue-600 text-white px-4 py-2 rounded">Login</button>
      </form>
    </div>
  );
};

export default Login;
